import './index.scss'
export default {
  render () {
    return (
      <a href="https://support.qq.com/product/93432" target="_blank">
        <div class="feedback-link">
          <div class="logo-wrap">
            <div class="logo"></div>
          </div>
          <div class="tips-wrap fade-in">
            <div class="tips"><span>社区/论坛/说点啥</span>
            </div>
          </div>
        </div>
      </a>
    )
  }
}
